import React, { useState } from 'react';
import styled from 'styled-components';

const SignUpPage = () => {
  const [email, setEmail] = useState('');
  const [authNumber, setAuthNumber] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [phone, setPhone] = useState('');
  const [nickname, setNickname] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // 회원가입 처리 로직 추가
    console.log('이메일:', email);
    console.log('인증 번호:', authNumber);
    console.log('비밀번호:', password);
    console.log('비밀번호 확인:', confirmPassword);
    console.log('휴대폰 번호:', phone);
    console.log('닉네임:', nickname);
  };

  return (
    <Container>
      <Logo>iTeaMoa</Logo>
      <Form onSubmit={handleSubmit}>
        <Label>이 메 일</Label>
        <Input 
          type="email" 
          value={email} 
          onChange={(e) => setEmail(e.target.value)} 
          placeholder="이메일 입력" 
          required 
        />
        <Label>인 증 번 호</Label>
        <Input 
          type="text" 
          value={authNumber} 
          onChange={(e) => setAuthNumber(e.target.value)} 
          placeholder="인증번호 입력" 
          required 
        />
        <Label>비밀번호</Label>
        <Input 
          type="password" 
          value={password} 
          onChange={(e) => setPassword(e.target.value)} 
          placeholder="비밀번호 입력" 
          required 
        />
        <Label>비밀번호 확인</Label>
        <Input 
          type="password" 
          value={confirmPassword} 
          onChange={(e) => setConfirmPassword(e.target.value)} 
          placeholder="비밀번호를 다시 입력해주세요." 
          required 
        />
        <Label>휴 대 폰 번 호</Label>
        <Input 
          type="tel" 
          value={phone} 
          onChange={(e) => setPhone(e.target.value)} 
          placeholder="휴대폰 번호 입력" 
          required 
        />
        <Label>닉 네 임</Label>
        <Input 
          type="text" 
          value={nickname} 
          onChange={(e) => setNickname(e.target.value)} 
          placeholder="닉네임 입력" 
          required 
        />
        <Button type="submit">가입하기</Button>
        <SocialLoginContainer>
          <SocialButton yellow>카카오로 시작하기</SocialButton>
          <SocialButton green>네이버로 시작하기</SocialButton>
        </SocialLoginContainer>
      </Form>
    </Container>
  );
};

export default SignUpPage;

// Styled Components
const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 100vh;
  background-color: #f9f9f9;
`;

const Logo = styled.h1`
  font-size: 36px;
  margin-bottom: 20px;
`;

const Form = styled.form`
  display: flex;
  flex-direction: column;
  width: 300px;
`;

const Label = styled.label`
  margin: 10px 0 5px;
  font-size: 14px;
`;

const Input = styled.input`
  padding: 10px;
  border: 1px solid #ccc;
  border-radius: 5px;
  margin-bottom: 15px;
`;

const Button = styled.button`
  padding: 10px;
  background-color: #0080ff;
  color: white;
  border: none;
  border-radius: 5px;
  cursor: pointer;
  margin-bottom: 10px;
`;

const SocialLoginContainer = styled.div`
  display: flex;
  flex-direction: column;
`;

const SocialButton = styled.button`
  padding: 10px;
  background-color: ${props => (props.yellow ? '#f7e02e' : '#3dbd4e')};
  color: white;
  border: none;
  border-radius: 5px;
  cursor: pointer;
  margin-top: 5px;
`;
